import styled from "styled-components";
function Header() {
    const HeaderContainer = styled.div`
        background : black;
        color   :   white;
        padding :   12px 64px;
        display :   flex;
        flex-direction  :   row;
        justify-content :   space-between;
    `;

    const HeaderSubContainer = styled.div`
        color   :   white;
        padding :   8px;
        display :   flex;
        flex-direction  :   row;
        font-weight : 600;
        align-items :   center;
        gap     :   20px;
    `;

    const SearchBar = styled.div`
        background  :   #1b1b1b;
        color       :   #DDDDDD;
        border-radius : 128px;
        padding     : 16px 32px;
        border      :   1px solid #303030;
        width       : 600px;
        height      : 16px;
    `;

    const PrimaryGlowingButton = styled.div`
        background  :   #1b1b1b;
        color       :   #DDDDDD;
        border-radius : 128px;
        padding     : 16px 32px;
        border      :   1px solid #303030;

    `;

    return (
    <div>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>
            <SearchBar></SearchBar>
        </HeaderSubContainer>
        <HeaderSubContainer>
            <PrimaryGlowingButton>Account</PrimaryGlowingButton>
            <PrimaryGlowingButton>Notifications</PrimaryGlowingButton>
        </HeaderSubContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
